column2:
Customer is having coverage issues indoors in Hazara Colony. High degree of interference prevails in the area due to which most sites are heavily down-tilted. Also, KKZ602-3?s BCCH frequency face interference captured in below snapshot.

Recommendations are:

@Zeeshan: Change KKZ602-3's BCCH frequency.

@Abrar: Swap KKZ602-3 antenna with higher gain, 686, in hopes to minimize interference by tilt adjustments.

@Noman: Once we have 686 installed, modify tilts on KKZ602-3: 12/5 -> 9/4
